import React from "react";
import styled from "styled-components";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import anupama from "../Slider/anupama.webp";
import atrangi from "../Slider/atrangi.webp";
import drama from "../Slider/drama.webp";
import imlie from "../Slider/imlie.webp";
import serial from "../Slider/serial.webp";

const TraySlider = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 5,
    slidesToScroll: 1,
  };
  return (
    <Tray>
      <h3>Latest & Trending</h3>
      <Content {...settings}>
        <Wrap>
          <img src={anupama} alt="Im" />
        </Wrap>
        <Wrap>
          <img src={atrangi} alt="Im" />
        </Wrap>
        <Wrap>
          <img src={drama} alt="Im" />
        </Wrap>
        <Wrap>
          <img src={serial} alt="Im" />
        </Wrap>
        <Wrap>
          <img src={imlie} alt="Im" />
        </Wrap>
      </Content>
    </Tray>
  );
};

export default TraySlider;

const Tray = styled.div`
  position: relative;

  h3 {
    color: #fff;
  }
`;
const Content = styled(Slider)``;
const Wrap = styled.div`
  position: relative;
  height: 100px;
  width: 20vww;

  img {
    width: 100%;
    height: 100%;
    margin-right: 15px;
  }
`;
